import React from 'react'
import { Box } from '@mui/material'
import './index.css'

const Home
 = () => {
  return (
    <Box className='home-container'>
      <img src='https://res.cloudinary.com/ddruw0mnk/image/upload/v1741877811/13258d34acb4f447b53c9a567eacde69_emdjn6.png' alt='logo' />
    </Box>
  )
}

export default Home
